import React from "react";
import {Switch, BrowserRouter, Route} from "react-router-dom";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route></Route>
        <Route></Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
